static int write_pcr_bits(uint8_t *buf, int64_t pcr)
{
    int64_t pcr_low = pcr % 300, pcr_high = pcr / 300;

    *buf++ = pcr_high >> 25;
    *buf++ = pcr_high >> 17;
    *buf++ = pcr_high >>  9;
    *buf++ = pcr_high >>  1;
    *buf++ = pcr_high <<  7 | pcr_low >> 8 | 0x7e;
    *buf++ = pcr_low;

    return 6;
}

static void write_pts(uint8_t *q, int fourbits, int64_t pts)
{
    int val;

    val  = fourbits << 4 | (((pts >> 30) & 0x07) << 1) | 1;
    *q++ = val;
    val  = (((pts >> 15) & 0x7fff) << 1) | 1;
    *q++ = val >> 8;
    *q++ = val;
    val  = (((pts) & 0x7fff) << 1) | 1;
    *q++ = val >> 8;
    *q++ = val;
}

/* Set an adaptation field flag in an MPEG-TS packet*/
static void set_af_flag(uint8_t *pkt, int flag)
{
    // expect at least one flag to set
    //av_assert0(flag);

    if((pkt[3] & 0x20) == 0) {
        // no AF yet, set adaptation field flag
        pkt[3] |= 0x20;
        // 1 byte length, no flags
        pkt[4] = 1;
        pkt[5] = 0;
    }

    pkt[5] |= flag;
}

/* Extend the adaptation field by size bytes */
static void extend_af(uint8_t *pkt, int size)
{
    // expect already existing adaptation field
    //av_assert0(pkt[3] & 0x20);
    pkt[4] += size;
}

/* Get a pointer to MPEG-TS payload (right after TS packet header) */
static uint8_t *get_ts_payload_start(uint8_t *pkt)
{
    if(pkt[3] & 0x20)
        return pkt + 5 + pkt[4];
    else
        return pkt + 4;
}

/* Write a single null transport stream packet */
static void mpegts_insert_null_packet(void)
{
    uint8_t *q;
    uint8_t buf[TS_PACKET_SIZE];

    q    = buf;
    *q++ = 0x47;
    *q++ = 0x00 | 0x1f;
    *q++ = 0xff;
    *q++ = 0x10;
    memset(q, 0x0FF, TS_PACKET_SIZE - (q - buf));
#ifdef DEBUG_FILE
    fwrite(buf, 1, TS_PACKET_SIZE, g_out_fp);
#else
    udp_send_to_host(buf, TS_PACKET_SIZE);
#endif
}

int64_t av_rescale_rnd(int64_t a, int64_t b, int64_t c, enum AVRounding rnd)
{
    int64_t r = 0;
    //av_assert2(c > 0);
   // av_assert2(b >=0);
   // av_assert2((unsigned)(rnd&~AV_ROUND_PASS_MINMAX)<=5 && (rnd&~AV_ROUND_PASS_MINMAX)!=4);

    if (c <= 0 || b < 0 || !((unsigned)(rnd&~AV_ROUND_PASS_MINMAX)<=5 && (rnd&~AV_ROUND_PASS_MINMAX)!=4))
        return INT64_MIN;

    if (rnd & AV_ROUND_PASS_MINMAX) {
        if (a == INT64_MIN || a == INT64_MAX)
            return a;
        rnd -= AV_ROUND_PASS_MINMAX;
    }

    if (a < 0)
        return -(uint64_t)av_rescale_rnd(-FFMAX(a, -INT64_MAX), b, c, rnd ^ ((rnd >> 1) & 1));

    if (rnd == AV_ROUND_NEAR_INF)
        r = c / 2;
    else if (rnd & 1)
        r = c - 1;

    if (b <= INT32_MAX && c <= INT32_MAX) {
        if (a <= INT32_MAX)
            return (a * b + r) / c;
        else {
            int64_t ad = a / c;
            int64_t a2 = (a % c * b + r) / c;
            if (ad >= INT32_MAX && b && ad > (INT64_MAX - a2) / b)
                return INT64_MIN;
            return ad * b + a2;
        }
    } else {
        uint64_t a0  = a & 0xFFFFFFFF;
        uint64_t a1  = a >> 32;
        uint64_t b0  = b & 0xFFFFFFFF;
        uint64_t b1  = b >> 32;
        uint64_t t1  = a0 * b1 + a1 * b0;
        uint64_t t1a = t1 << 32;
        int i;

        a0  = a0 * b0 + t1a;
        a1  = a1 * b1 + (t1 >> 32) + (a0 < t1a);
        a0 += r;
        a1 += a0 < r;

        for (i = 63; i >= 0; i--) {
            a1 += a1 + ((a0 >> i) & 1);
            t1 += t1;
            if (c <= a1) {
                a1 -= c;
                t1++;
            }
        }
        if (t1 > INT64_MAX)
            return INT64_MIN;
        return t1;

    }
}

int64_t av_rescale(int64_t a, int64_t b, int64_t c)
{
    return av_rescale_rnd(a, b, c, AV_ROUND_NEAR_INF);
}

int mpegts_start_packet(MpegTSWriteStream *ts_st)
{
    uint8_t buf[TS_PACKET_SIZE];
    int64_t delay = 0;//av_rescale(2, 90000, AV_TIME_BASE);
    int64_t pcr = -1;
    uint8_t *q;
    int val,  len, header_len, flags;
    int64_t pts, dts;
    uint8_t *payload;
    int payload_size;

    payload = ts_st->payload;
    payload_size = ts_st->payload_size;
    pts =  ts_st->payload_pts;
    dts =  ts_st->payload_pts;
    q    = buf;
    *q++ = 0x47;
    val  = ts_st->pid >> 8;
    val |= 0x40;
    *q++      = val;
    *q++      = ts_st->pid;
    ts_st->cc = (ts_st->cc + 1) & 0xf;
    *q++      = 0x10 | ts_st->cc; // payload indicator + CC
    set_af_flag(buf, 0x40);
    q = get_ts_payload_start(buf);

    if(ts_st->codec_type == AVMEDIA_TYPE_VIDEO) { //wirte pcr
        set_af_flag(buf, 0x10);
        q = get_ts_payload_start(buf);
        pcr = (dts - delay) * 300;
        extend_af(buf, write_pcr_bits(q, pcr));
        q = get_ts_payload_start(buf);
    }

    *q++ = 0x00;
    *q++ = 0x00;
    *q++ = 0x01;

    if(ts_st->codec_type == AVMEDIA_TYPE_VIDEO) {
        *q++ = 0xe0;
    } else if(ts_st->codec_type == AVMEDIA_TYPE_AUDIO) {
        *q++ = 0xc0;
    }

    header_len = 0;
    flags      = 0;

    if(pts != AV_NOPTS_VALUE) {
        header_len += 5;
        flags      |= 0x80;
    }

    len = payload_size + header_len + 3;

    if(len > 0xffff)
        len = 0;

    if(ts_st->codec_type == AVMEDIA_TYPE_VIDEO) {
        len = 0;
    }

    *q++ = len >> 8;
    *q++ = len;
    val  = 0x80;

    *q++ = val;
    *q++ = flags;
    *q++ = header_len;

    if(pts != AV_NOPTS_VALUE) {
        write_pts(q, flags >> 6, pts);
        q += 5;
    }

    /* header size */
    header_len = q - buf;
    /* data len */
    len = TS_PACKET_SIZE - header_len;
    memcpy(buf + TS_PACKET_SIZE - len, payload, len);
    //avio_write(s->pb, buf, TS_PACKET_SIZE);
    //USART3_Putbuf(buf,TS_PACKET_SIZE);
    ts_st->payload      += len;
    ts_st->payload_size -= len;

#ifdef DEBUG_FILE
    fwrite(buf, 1, TS_PACKET_SIZE, g_out_fp);
#else
    udp_send_to_host(buf, TS_PACKET_SIZE);
#endif
    return len;
}

//const uint8_t *payload, int payload_size,
int mpegts_normal_packet(MpegTSWriteStream *ts_st)
{
    uint8_t buf[TS_PACKET_SIZE];
    //int64_t delay = 0;//av_rescale(0, 90000, AV_TIME_BASE);
    int afc_len, stuffing_len;
    uint8_t *q;
    int len, header_len;
    uint8_t *payload;
    int payload_size;
    payload = ts_st->payload;
    payload_size = ts_st->payload_size;

    /* prepare packet header */
    while(payload_size > 0) {
        q    = buf;
        *q++ = 0x47;
        *q++      =  ts_st->pid >> 8;
        *q++      = ts_st->pid;
        ts_st->cc = (ts_st->cc + 1) & 0xf;
        *q++      = 0x10 | ts_st->cc; // payload indicator + CC
        /* header size */
        header_len = q - buf;
        /* data len */
        len = TS_PACKET_SIZE - header_len;

        if(len > payload_size)
            len = payload_size;

        stuffing_len = TS_PACKET_SIZE - header_len - len;

        if(stuffing_len > 0) {
            /* add stuffing with AFC */
            if(buf[3] & 0x20) {
                /* stuffing already present: increase its size */
                afc_len = buf[4] + 1;
                memmove(buf + 4 + afc_len + stuffing_len,
                        buf + 4 + afc_len,
                        header_len - (4 + afc_len));
                buf[4] += stuffing_len;
                memset(buf + 4 + afc_len, 0xff, stuffing_len);
            } else {
                /* add stuffing */
                memmove(buf + 4 + stuffing_len, buf + 4, header_len - 4);
                buf[3] |= 0x20;
                buf[4]  = stuffing_len - 1;

                if(stuffing_len >= 2) {
                    buf[5] = 0x00;
                    memset(buf + 6, 0xff, stuffing_len - 2);
                }
            }
        }

        /* data len */

        memcpy(buf + TS_PACKET_SIZE - len, payload, len);
        payload      += len;
        payload_size -= len;

#ifdef DEBUG_FILE
        fwrite(buf, 1, TS_PACKET_SIZE, g_out_fp);
#else
        udp_send_to_host(buf, TS_PACKET_SIZE);
#endif
    }

    ts_st->payload = payload;
    ts_st->payload_size = payload_size;
    return len;
    //avio_write(s->pb, buf, TS_PACKET_SIZE);
}
