extern void pollintTs(void)
{
    //int len;
    while(av_state == END_PACKET) {
        return;
    }

    switch(av_state) {
    case START_PACKET:
        //PAT_PMT
        PAT_DAT[3] = 0x10 | pat_pmt_cc; // payload indicator + CC
        PMT_DAT[3] = PAT_DAT[3]; // payload indicator + CC
        pat_pmt_cc = (pat_pmt_cc + 1) & 0xf;
#ifdef DEBUG_FILE
        fwrite(PAT_DAT, 1, sizeof(PAT_DAT), g_out_fp);
		fwrite(PMT_DAT, 1, sizeof(PMT_DAT), g_out_fp);
#else
        udp_send_to_host(PAT_DAT, sizeof(PAT_DAT));
	   udp_send_to_host(PMT_DAT, sizeof(PMT_DAT));
#endif
        ts_st_a.is_start = 1;
        ts_st_a.payload = mp2packt;
        ts_st_a.payload_size = sizeof(mp2packt);
        ts_st_v.is_start = 1;
        ts_st_v.payload = pack_quene[test_loop].p;
        ts_st_v.payload_size = pack_quene[test_loop].len;
        av_state = VIDEO_PACKET;

        test_loop++;

        break;

    case VIDEO_PACKET:
        if(ts_st_v.is_start) {
            ts_st_v.is_start = 0;
            mpegts_start_packet(&ts_st_v);
            ts_st_v.payload_pts += 1500; //90000/60;
        } else {
            mpegts_normal_packet(&ts_st_v);
        }

        if(ts_st_v.payload_size == 0) {
            av_state = AUIDO_PACKET;
        }

        break;

    case AUIDO_PACKET:
        if(ts_st_a.is_start) {
            ts_st_a.is_start = 0;
            mpegts_start_packet(&ts_st_a);
            ts_st_a.payload_pts += 2160;
        } else {
            mpegts_normal_packet(&ts_st_a);
        }

        if(ts_st_a.payload_size == 0) {
			if(test_loop == 1) {
				av_state = END_PACKET;
			}
			else{
				av_state = START_PACKET;
			}
        }

        break;

    case END_PACKET:
    default:
        break;
    }
}


